import './App.css';
import Mainpage from './componente_student/Mainpage';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Login from './front_componente/Login';
import SignUp from './front_componente/SignUp';
function App() {
  return (
    <div className="App">



        <Route  exact path='/'>
              <Login/>
          </Route>
        <Route   path='/SignUp'>
              <SignUp/>
          </Route>

          <Route  path='/mainpage'>
              <Mainpage />
            </Route>





      </div>
  );
}

export default App;
